import React from "react";
import { Outlet, createBrowserRouter } from "react-router-dom";
import Login from "../Login/Login";
import Home from "../Home";
import Signup from "../Login/Signup";

const AuthLayout = () => {
  return <Outlet />;
};

export default createBrowserRouter([
  {
    element: <AuthLayout />,
    children: [
      {
        element: <Signup />,
        path: "/signup",
      },
      {
        element: <Login />,
        path: "/login",
      },
      {
        element: <Home />,
        path: "/",
      },
    ],
  },
]);
